INSERT INTO ascendco.trays_per_hour (            assemble_date,            assemble_day_name,            assemble_day_of_week,            facility_id,            facility_name,            hours_assembly,            hsys_id,            hsys_name,            inst_assembled,            inst_per_hour,            trays_assembled,            trays_per_hour,            user_id,            user_name)      SELECT              expanded_data."Assemble_Date",             expanded_data."Assemble_DayName",             expanded_data."Assemble_DayOfWeek",             expanded_data."FacilityID",             expanded_data."FacilityName",             expanded_data."HoursAssembly",             expanded_data."HsysID",             expanded_data."HsysName",             expanded_data."InstAssembled",             expanded_data."InstPerHour",             expanded_data."TraysAssembled",             expanded_data."TraysPerHour",             expanded_data."UserID",             expanded_data."UserName"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "Assemble_Date" date,             "Assemble_DayName" citext,             "Assemble_DayOfWeek" float8,             "FacilityID" uuid,             "FacilityName" citext,             "HoursAssembly" float8,             "HsysID" uuid,             "HsysName" citext,             "InstAssembled" float8,             "InstPerHour" float8,             "TraysAssembled" float8,             "TraysPerHour" float8,             "UserID" uuid,             "UserName" citext)       WHERE dataset_name = 'TraysPerHour_PG' AND             view_version = '1'